import { Card, CardContent, Typography, Box } from "@mui/material";
import WaterDropIcon from "@mui/icons-material/WaterDrop";
import { blue } from "@mui/material/colors";

export default function HumidityContainer({ humidity }) {
  return (
    <Card
      variant="outlined"
      sx={{
        background: blue[50],
        borderRadius: 4,
        boxShadow: 3,
        width: "100%",
        my: 2,
      }}
    >
      <CardContent sx={{ display: "flex", alignItems: "center", gap: 2 }}>
        <WaterDropIcon sx={{ fontSize: 50, color: blue[500] }} />
        <Box>
          <Typography variant="h6" fontWeight={500}>Humidity</Typography>
          <Typography variant="h5">{humidity}%</Typography>
        </Box>
      </CardContent>
    </Card>
  );
}
